import React, { useState } from 'react'
import { FaSearch } from "react-icons/fa"
import "./SearchBarIcon.css"
import axios from 'axios'
import {useParams} from "react-router-dom"

const SearchIcon = () => {
  const[input, setInput] = useState("")
  const{id} = useParams();
  console.log(id)

  const Data = (value) =>{
    const axiosInstance = axios.create({withCredentials: true, headers: {
      "Content-type": "application/json",
    }})
    axiosInstance.get("http://localhost:7078/")
    .then(res=> console.log(res))
    .catch(err=> console.log(err))
    // const result = res.filter(())
  }

  const handleChange = (value) => {
    setInput(value)
    Data(value)
  }

  return (
    <div className="input-wrapper">
        <FaSearch id = "search_icon"/> 
        <input type="text" placeholder="Type to search..." value={input} onChange={(e)=> handleChange(e.target.value)}/>
    </div>
  )
}

export default SearchIcon
